	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 566px; min-height: 300px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 556px; min-height: 290px;\"><p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​​​​​​​​</span></p>\n\n<ul>\n	<li><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">I periodesystemet er alle grunnstoffene ordnet etter økende atomnummer. Atomnummeret er det samme som antall protoner i kjernen.</span></li>\n</ul>\n\n<p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​</span></p>\n\n<p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​</span></p>\n\n<ul>\n	<li><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">De loddrette kolonnene kalles grupper. Nummeret på gruppa gir informasjon om antall elektroner i det ytterste skallet. Atomer som står i samme gruppe har like mange elektroner ytterst.</span></li>\n</ul>\n\n<p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​</span></p>\n\n<ul>\n	<li><span style=\"font-family: Arial, sans-serif; color: rgb(0, 0, 0); font-size:12pt;\">De vannrette radene kalles perioder, og angir hvor mange elektronskall atomene har. Atomer i samme periode har altså like mange elektronskall.</span></li>\n</ul>\n\n<p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​</span></p>\n\n<p><span style=\"color: rgb(0, 0, 0); font-size:12pt;\">​</span></p></div></div>",
